import { useEffect, useState } from "react";
import "./index.css"

function EmpList(){
    const [data,setData]=useState(null)
    useEffect(()=>{
        fetch("https://jsonplaceholder.typicode.com/posts")
        .then((res)=>{
            return res.json()
        })
        .then((resp)=>{
            console.log(resp)
            setData(resp)
        })
    })
    return(
        <div>
            <h1>Fetch data from backend</h1>
             <table>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Name</th>
                        <th>City</th>
                    </tr>
                </thead>
                <tbody>
                {data.map((item)=>(
                    <tr>
                        <td>{item.userId}</td>
                        <td>{item.id}</td>
                        <td>{item.title}</td>
                    </tr>
                     ))}
                </tbody>
             </table>
        </div>
    )
}
export default EmpList;
